import React, { useEffect, useState } from "react";
import RoleItem from "../../components/RoleItem/RoleItem";
import { URL_GOOGLE_SHEETS } from "../../constants";

const RolezandoList = () => {
  const [list, setList] = useState([]);
  const [hasError, setHasError] = useState(false);

  const getData = () => {
    const data = fetch(URL_GOOGLE_SHEETS)
      .then((res) => res.text().then((result) => console.log(result)))
      .then(() => setHasError);

    return data;
  };

  useEffect(() => {
    getData();
  }, []);

  console.log(list);

  return (
    <>
      {list.map((item) => (
        <RoleItem data={item} />
      ))}
    </>
  );
};

export default RolezandoList;
